$.avr=A.a(["Avatar: 2009 ABD yap\u0131m\u0131 destans\u0131 bilimkurgu filmi. Filmin senaryosunu Titanik, Yarat\u0131k 2, Terminat\xf6r filmlerinin y\xf6netmeni James Cameron yazm\u0131\u015f ve filmi y\xf6netmi\u015ftir. \xdc\xe7 boyutlu (3D) sinema tekni\u011fi ile \xe7ekilmi\u015ftir. 18 Aral\u0131k 2009 tarihinde g\xf6sterime girmi\u015ftir. Ayn\u0131 zamanda t\xfcm zamanlar\u0131n en \xe7ok has\u0131lat yapan film rekorunu elinde bulunduruyor. K\xfcresel has\u0131lat:2,923,706,026 dolar.","Avengers: Endgame, Marvel Comics'in \u0130ntikamc\u0131lar adl\u0131 s\xfcper kahraman grubundan uyarlanan ve Marvel Studios taraf\u0131ndan yap\u0131m\u0131 \xfcstlenilen ABD s\xfcper kahraman filmi. 2018 yap\u0131m\u0131 Avengers: Sonsuzluk Sava\u015f\u0131 filminin devam\u0131 niteli\u011finde olup yirmi ikinci Marvel Sinematik Evreni filmidir. Film, ABD'de 26 Nisan 2019'da vizyona girdi. 21 Temmuz tarihiyle elde etti\u011fi 2,79 milyar dolar has\u0131latla t\xfcm zamanlar\u0131n en y\xfcksek ikinci has\u0131lat\u0131n\u0131 yapan film oldu.","Titanik (\u0130ngilizce: Titanic), James Cameron'\u0131n y\xf6netmenlik, senaristlik, ortak yap\u0131mc\u0131l\u0131k, ve ortak kurgu y\xf6netmenli\u011fini yapt\u0131\u011f\u0131, 1997 y\u0131l\u0131 Amerikan yap\u0131m\u0131 epik, felaket, ve romantizm temal\u0131 sinema filmi. RMS Titanic'in bat\u0131\u015f\u0131 \xfczerine kurgulanan filmin ba\u015frollerini, geminin felaketle sonu\xe7lanan ilk seyahati s\u0131ras\u0131nda birbirine \xe2\u015f\u0131k olan farkl\u0131 toplumsal s\u0131n\u0131flara mensup iki genci canland\u0131ran Leonardo DiCaprio ve Kate Winslet payla\u015fmaktad\u0131r. K\xfcresel Has\u0131lat: 2.194.439.542 dolar.","Avatar: Suyun Yolu (\xd6zg\xfcn ad\u0131: Avatar: The Way of Water), James Cameron taraf\u0131ndan y\xf6netilen ve yap\u0131mc\u0131l\u0131\u011f\u0131n\u0131 20th Century Studios'un \xfcstlendi\u011fi ABD yap\u0131m\u0131 epik bilimkurgu filmidir.Cameron filmin yap\u0131mc\u0131l\u0131\u011f\u0131n\u0131 Jon Landau ile birlikte \xfcstlenirken, Josh Friedman ilk ba\u015fta Cameron'\u0131n ortak yazar\u0131 olarak duyurulmu\u015ftu; daha sonra Cameron, Friedman, Rick Jaffa, Amanda Silver ve Shane Salerno'nun ayr\u0131 senaryolara atfedilmeden \xf6nce t\xfcm devam filmlerinin yazma s\xfcrecinde yer ald\u0131klar\u0131 ve nihai belirsiz film jeneriklerini yazma halinde olduklar\u0131 a\xe7\u0131kland\u0131.K\xfcresel has\u0131lat:2.130.720.442.\t","Star Wars: G\xfc\xe7 Uyan\u0131yora, Y\u0131ld\u0131z Sava\u015flar\u0131 (Star Wars) serisine ait, ABD'de 18 Aral\u0131k 2015'te g\xf6sterime giren epik bilimkurgu uzay operas\u0131 t\xfcrlerinde bir filmdir. Y\u0131ld\u0131z Sava\u015flar\u0131: B\xf6l\xfcm VI - Jedi'\u0131n D\xf6n\xfc\u015f\xfc'nden yakla\u015f\u0131k 30 y\u0131l sonras\u0131nda ge\xe7en filmin konusu \u0130lk D\xfczen'den ka\xe7an Stormtrooper Finn'in Rey, Han Solo, Leia Organa ve Asi Birli\u011fi'yle birlikte kar\u015f\u0131lar\u0131na \xe7\u0131kan, Galaktik \u0130mparatorluk soyundan gelen Kylo Ren ve \u0130lk D\xfczen ile sava\u015farak Luke Skywalker'\u0131 aramaya \xe7al\u0131\u015fmalar\u0131d\u0131r.K\xfcresel Ha\u0131lat:2.068.223.624 dolar."],t.s)
