$.avh=A.a(["CODA, Sian Heder taraf\u0131ndan yaz\u0131lan ve y\xf6netilen re\u015fit olma \xfczerine 2021 yap\u0131m\u0131 bir komedi-drama filmidir. Filmde Emilia Jones, sa\u011f\u0131r bir ailenin tek i\u015fiten \xfcyesi olan CODA'y\u0131 (sa\u011f\u0131r yeti\u015fkinlerin \xe7ocu\u011funu ifade eden k\u0131saltma) canland\u0131r\u0131r. Eugenio Derbez, Troy Kotsur, Ferdia Walsh-Peelo, Daniel Durant ve Marlee Matlin yard\u0131mc\u0131 rollerde yer al\u0131r. Amerika Birle\u015fik Devletleri, Fransa ve Kanada aras\u0131nda uluslararas\u0131 bir ortak yap\u0131m olan film, Amerika Birle\u015fik Devletleri'nde Gloucester, Massachusetts'te \xe7ekildi. 2014 yap\u0131m\u0131 Frans\u0131z filmi La Famille B\xe9lier'in \u0130ngilizce versiyonudur. CODA d\xfcnya pr\xf6miyerini 28 Ocak 2021'de 2021 Sundance Film Festivali'nde yapt\u0131.94. Akademi \xd6d\xfclleri'nde En iyi Film, En \u0130yi Yard\u0131mc\u0131 Erkek Oyuncu ve En \u0130yi Uyarlama Senaryo dallar\u0131nda \xfc\xe7 \xf6d\xfcl kazand\u0131. ","Nomadland Chlo\xe9 Zhao'nun senaryosunu yazd\u0131\u011f\u0131, yap\u0131mc\u0131l\u0131\u011f\u0131n\u0131 \xfcstlendi\u011fi ve y\xf6netti\u011fi 2020 Amerikan drama filmidir. Filmde Frances McDormand, kocas\u0131 \xf6ld\xfckten sonra memleketi Nevada'dan ayr\u0131lan ve \"evsiz\" kal\u0131p, Amerika Birle\u015fik Devletleri'ni dola\u015fan bir kad\u0131n olarak rol al\u0131yor.Film, y\xf6netmenli\u011fi, senaryosu, kurgusu, sinematografisi ve performanslar\u0131, \xf6zellikle de McDormand'\u0131n performans\u0131ndan dolay\u0131 evrensel \xf6vg\xfc ile ele\u015ftirel be\u011feni toplad\u0131 ve Metacritic'te 2020'nin \xfc\xe7\xfcnc\xfc en y\xfcksek puan\u0131 alan filmi oldu. 2020'nin en iyi filmlerinden biri olarak ele\u015ftirmenler ve yay\u0131nc\u0131lar taraf\u0131ndan en \xe7ok derecelendirilen film oldu. Film 93. Akademi \xd6d\xfclleri'nde En \u0130yi Film, En \u0130yi Y\xf6netmen ve En \u0130yi Kad\u0131n Oyuncu McDormand dahil olmak \xfczere alt\u0131 adayl\u0131k kazand\u0131. ","Parazit, y\xf6netmenli\u011fi ve senaristli\u011fi Bong Joon-ho taraf\u0131ndan yap\u0131lan 2019 \xe7\u0131k\u0131\u015fl\u0131 G\xfcney Kore kara komedi, gerilim filmidir.Filmin senaryosu y\xf6netmen Bong Joon-ho ve Han Jin-won ile birlikte yaz\u0131lm\u0131\u015ft\u0131r. Ba\u015fl\u0131ca oyuncular\u0131 Song Kang-ho, Lee Sun-kyun, Cho Yeo-jeong, Choi Woo-shik ve Park So-dam'd\u0131r.Fakir bir aileden gelen gen\xe7 bir adam\u0131n zengin bir ailenin k\u0131z\u0131na \xf6zel ders vermesiyle ba\u015fl\u0131yor. Bu gen\xe7 adam, ebeveynleri ve karde\u015fiyle birlikte yava\u015f yava\u015f zengin ailenin \xf6zel hayat\u0131na s\u0131zmaya ba\u015flayacakt\u0131r. Genelde olumlu ele\u015ftiriler alan film, d\xfcnya \xe7ap\u0131nda 121,8 milyon dolar kazand\u0131 ve Bong'un en \xe7ok kazand\u0131\u011f\u0131 yap\u0131t\u0131 oldu.92. Oscar \xd6d\xfclleri'nde, En \u0130yi Film, En \u0130yi Y\xf6netmen, En \u0130yi Uluslararas\u0131 Film ve En \u0130yi Orijinal Senaryo \xf6d\xfcllerini kazand\u0131.","Green Book, Peter Farrelly taraf\u0131ndan y\xf6netilen 2018 Amerikan biyografik komedi-drama filmidir . Ba\u015frollerini Viggo Mortensen ve Mahershala Ali'nin payla\u015ft\u0131\u011f\u0131 Afrikal\u0131 Amerikal\u0131 piyanist Don Shirley ile Shirley'nin \u015fof\xf6r\xfc ve korumas\u0131 olarak g\xf6rev yapan \u0130talyan Amerikal\u0131 fedai ve daha sonra akt\xf6r Frank \"Tony Lip\" Vallelonga'n\u0131n 1962'de Derin G\xfcney'e yapt\u0131\u011f\u0131 turun ger\xe7ek hikayesinden esinlenmi\u015ftir.En \u0130yi Film , En \u0130yi \xd6zg\xfcn Senaryo ve En \u0130yi Yard\u0131mc\u0131 Erkek Oyuncu (Ali i\xe7in) dallar\u0131nda Akademi \xd6d\xfcl\xfc kazand\u0131 . Ayr\u0131ca En \u0130yi Tiyatro Filmi dal\u0131nda Amerika Yap\u0131mc\u0131lar Birli\u011fi \xd6d\xfcl\xfc'n\xfc , En \u0130yi Film - M\xfczikal veya Komedi dal\u0131nda Alt\u0131n K\xfcre \xd6d\xfcl\xfc'n\xfc ve 2018'in en iyi filmi dal\u0131nda Ulusal \u0130nceleme Kurulu \xf6d\xfcl\xfcn\xfc kazand\u0131.","Suyun Sesi, Guillermo del Toro taraf\u0131ndan y\xf6netilen ve senaryosu del Toro ile birlikte Vanessa Taylor taraf\u0131ndan yaz\u0131lan, 2017 \xe7\u0131k\u0131\u015fl\u0131 Amerikan yap\u0131m\u0131 romantik, fantastik bir filmdir. Ba\u015frollerinde Sally Hawkins, Michael Shannon, Richard Jenkins, Doug Jones, Michael Stuhlbarg ve Octavia Spencer'\u0131n yer ald\u0131\u011f\u0131 film, 1962'de Baltimore'de ge\xe7mektedir ve G\xfcney Amerika'da yakalanm\u0131\u015f bir amfibiyen ile gizli bir laboratuvarda \xe7al\u0131\u015fan konu\u015fma engelli temizlik i\u015f\xe7isi aras\u0131nda ge\xe7en hik\xe2yeyi anlatmaktad\u0131r.Filmin ilk g\xf6sterimi, 31 A\u011fustos 2017'de 74. Venedik Uluslararas\u0131 Film Festivali'nin ana yar\u0131\u015fma b\xf6l\xfcm\xfcnde g\xf6sterilerek ger\xe7ekle\u015ftirildi ve yar\u0131\u015fmada \"En \u0130yi Film\" \xf6d\xfcl\xfc olan Alt\u0131n Aslan'\u0131 kazanm\u0131\u015ft\u0131r.Amerikan Film Enstit\xfcs\xfc, Suyun Sesi'ni y\u0131l\u0131n en iyi 10 filminden biri olarak se\xe7ti."],t.s)
