$.auF=A.a(["2022 En \u0130yi Erkek Oyuncu Oscar'\u0131, Kral Richard:Y\xfckselen \u015eampiyonlar filmi i\xe7erisinde yer alan akt\xf6r Will Smith'e verilmi\u015ftir.Willard Christopher \"Will\" Smith, Jr., Amerikal\u0131 sinema oyuncusu, yap\u0131mc\u0131 ve rap m\xfczisyeni. Biri k\u0131z, ikisi erkek olmak \xfczere \xfc\xe7 \xe7ocu\u011fu vard\u0131r. Will'in son sekiz filmi gi\u015felerden 100 milyon dolar ve \xfcst\xfc gelir getirmi\u015ftir. K\u0131z\u0131lderili ve Afrika k\xf6kenlidir. Babas\u0131 buzdolab\u0131 tamircisiydi. ","2021 En \u0130yi Erkek Oyuncu Oscar'\u0131, Baba filmi i\xe7erisinde yer alan akt\xf6r Anthony Hopkins'e verilmi\u015ftir.Sir Philip Anthony Hopkins  akt\xf6r, y\xf6netmen, yap\u0131mc\u0131, besteci ve ressamd\u0131r. Britanya \u0130mparatorluk Ni\u015fan\u0131 (CBE) sahibidir.1957'de Galler Kraliyet M\xfczik ve Tiyatro okulundan mezun olduktan sonra Londra'da bulunan Kraliyet Tiyatro Sanat Akademisi'nde e\u011fitim g\xf6rm\xfc\u015f ve kendisini Kraliyet Ulusal Tiyatrosu'na davet eden Laurence Olivier taraf\u0131ndan ke\u015ffedilmi\u015ftir.","2020 En \u0130yi Erkek Oyuncu Oscar'\u0131, Joker filmi i\xe7erisinde yer alan akt\xf6r Joaquin Phoenix'e verilmi\u015ftir.Joaquin Rafael Phoenix (d. 28 Ekim 1974, San Juan), Leaf Phoenix olarak da bilinir, Amerikal\u0131 oyuncu, m\xfczik videosu y\xf6netmeni, prod\xfckt\xf6r, m\xfczisyen ve aktivist. Ridley Scott'\u0131n y\xf6netti\u011fi Gladyat\xf6r filmindeki Commodus rol\xfcyle dikkatleri \xfczerine \xe7ekmi\u015ftir.","2019 En \u0130yi Erkek Oyuncu Oscar'\u0131, Bohemian Rhapsody filmi i\xe7erisinde yer alan akt\xf6r Rami Malek'e verilmi\u015ftir.Rami Said Malek (d. 12 May\u0131s 1981, Los Angeles), Amerikal\u0131 oyuncu ve yap\u0131mc\u0131. Mr. Robot adl\u0131 televizyon dizisinde canland\u0131rd\u0131\u011f\u0131 hacker Elliot Alderson karakteriyle tan\u0131n\u0131r."],t.s)
