$.auG=A.a(["Troy Michael Kotsur (24 Temmuz 1968 do\u011fumlu), i\u015fitme engelli bir Amerikal\u0131 oyuncu. En \xe7ok 2021 filmi CODA'daki yard\u0131mc\u0131 rol\xfcyle tan\u0131n\u0131r ve bu rol\xfcyle En \u0130yi Yard\u0131mc\u0131 Erkek Oyuncu dal\u0131nda Akademi \xd6d\xfcl\xfc'n\xfc kazanm\u0131\u015ft\u0131r. Ayr\u0131ca \xdcst\xfcn Yard\u0131mc\u0131 Rol Performans\u0131 dal\u0131nda Gotham \xd6d\xfcl\xfc'n\xfc kazand\u0131.Kotsur, 24 Temmuz 1968'de Mesa, Arizona'da Jodee ve polis \u015fefi Leonard Stephen \"Len\" Kotsur'un \xe7ocu\u011fu olarak d\xfcnyaya geldi. Kotsur dokuz ayl\u0131kken ailesi onun sa\u011f\u0131r oldu\u011funu ke\u015ffetti ve ailesi ileti\u015fim kurabilmesi i\xe7in Amerikan \u0130\u015faret Dilini \xf6\u011frendil. Ebeveynleri, Kotsur'u spor yapmaya ve mahallelerindeki i\u015fiten \xe7ocuklarla arkada\u015f olmaya te\u015fvik etti. Kotsur, Phoenix Sa\u011f\u0131rlar Okulu'na gitti ve ilk kez orada oyunculukla ilgilenmeye ba\u015flad\u0131. Westwood Lisesi'nden mezun oldu. Lisede, drama \xf6\u011fretmeni onu varyete \u015fovuna kat\u0131lmaya te\u015fvik etti ve onu tiyatroya devam etmesi i\xe7in motive eden bir pandomim skeci yapt\u0131.","Daniel Kaluuya ( 24 \u015eubat 1989 do\u011fumlu) \u0130ngiliz akt\xf6r. Hem beyaz perdede hem de sahnede \xf6ne \xe7\u0131kan oyuncu, bir Akademi \xd6d\xfcl\xfc , iki BAFTA \xd6d\xfcl\xfc ve bir Alt\u0131n K\xfcre \xd6d\xfcl\xfc de dahil olmak \xfczere \xe7ok say\u0131da \xf6d\xfcl ald\u0131. Skins (2007\u20132009) adl\u0131 televizyon dizisinin ilk iki sezonunda Posh Kenneth'i canland\u0131rd\u0131 ; ayr\u0131ca baz\u0131 b\xf6l\xfcmlerin ortak yazarl\u0131\u011f\u0131n\u0131 yapt\u0131.  Kaluuya , 2010 y\u0131l\u0131nda Royal Court Theatre'da Sucker Punch'taki ba\u015frol performans\u0131yla \xf6vg\xfc toplad\u0131 . Psychoville (2009\u20132011), The Fades (2011) ve Black Mirror b\xf6l\xfcm\xfc \"Fifteen Million Merits \" (2011).  Ayr\u0131ca Johnny English Reborn (2011), Kick-Ass 2 (2013) ve Sicario (2015) filmlerinde yard\u0131mc\u0131 roller \xfcstlendi .Kaluuya, 2017'de Jordan Peele'nin korku filmi Get Out'ta oynayarak \xe7\u0131\u011f\u0131r a\xe7t\u0131 ve ona En \u0130yi Erkek Oyuncu Akademi \xd6d\xfcl\xfc'ne aday g\xf6sterildi. Biyopik Yahuda ve Kara Mesih'te (2021) Kara Panter Partisi lideri Fred Hampton'\u0131 canland\u0131rmas\u0131yla BAFTA kazand\u0131 ve En \u0130yi Yard\u0131mc\u0131 Erkek Oyuncu Akademi \xd6d\xfcl\xfc . ","Brad Pitt, Bir Zamanlar Hollywood'da filmiyle 2020 y\u0131l\u0131nda En \u0130yi Yard\u0131mc\u0131 Erkek Oyuncu Oscar \xf6d\xfcl\xfcn\xfc alm\u0131\u015ft\u0131r.William Bradley Pitt (18 Aral\u0131k 1963; Shawnee, Oklahoma, ABD), Amerikal\u0131 oyuncu ve film yap\u0131mc\u0131s\u0131d\u0131r. Yap\u0131m \u015firketi Plan B Entertainment ile yap\u0131mc\u0131 olarak bir Akademi \xd6d\xfcl\xfc ve Primetime Emmy \xd6d\xfcl\xfc'n\xfcn yan\u0131 s\u0131ra oyunculu\u011fuyla iki Alt\u0131n K\xfcre \xd6d\xfcl\xfc ve bir Akademi \xd6d\xfcl\xfc de d\xe2hil olmak \xfczere bir\xe7ok \xf6d\xfcl almaya hak kazanm\u0131\u015ft\u0131r.Missouri \xdcniversitesinin gazetecilik b\xf6l\xfcm\xfcnden mezun olmas\u0131na k\u0131sa bir s\xfcre kala, uzun s\xfcredir akl\u0131nda olan oyunculuk kariyerini ba\u015flatmak i\xe7in ailesine Pasadena'daki bir G\xfczel Sanatlar Akademisi'ne devam edece\u011fini s\xf6yleyerek Hollywood'a gitti. Bir s\xfcre \xe7e\u015fitli tan\u0131t\u0131mlarda tavuk kost\xfcm\xfc giyip limuzin \u015fof\xf6rl\xfc\u011f\xfc gibi i\u015fler yapt\u0131ktan sonra Dallas ve Another World gibi dizilerde k\xfc\xe7\xfck rollerde oynamaya ba\u015flad\u0131.   ","Mahershala Ali (d. Mahershalalhashbaz Gilmore, 16 \u015eubat 1974; Oakland, Kaliforniya), Amerikal\u0131 oyuncu.2016'da Juan karakterini canland\u0131rd\u0131\u011f\u0131 Ay I\u015f\u0131\u011f\u0131 filmiyle En \u0130yi Yard\u0131mc\u0131 Erkek Oyuncu dal\u0131nda Alt\u0131n K\xfcre'ye aday olmu\u015f, SAG \xd6d\xfcl\xfcn\xfcn ve Ele\u015ftirmenlerin Se\xe7imi \xd6d\xfcl\xfcn\xfcn ise sahibi olmu\u015ftur. 89. Akademi \xd6d\xfclleri'nde En \u0130yi Yard\u0131mc\u0131 Erkek Oyuncu \xf6d\xfcl\xfcn\xfc kazand\u0131.2018 yap\u0131m\u0131 Ye\u015fil Rehber filmindeki rol\xfcyle En \u0130yi Yard\u0131mc\u0131 Erkek Oyuncu Alt\u0131n K\xfcre \xd6d\xfcl\xfc'n\xfc kazanm\u0131\u015ft\u0131r."],t.s)
