$.ava=A.a(["Jessica Chastain, Tammy Faye'In G\xf6zleri filmiyle 2022 y\u0131l\u0131 En \u0130yi Kad\u0131n Oyuncu Oscar'\u0131n\u0131 alm\u0131\u015ft\u0131r.Jessica Michelle Chastain (24 Mart 1977 do\u011fumlu) Amerikal\u0131 aktris ve yap\u0131mc\u0131d\u0131r. Akademi \xd6d\xfcl\xfc, Alt\u0131n K\xfcre \xd6d\xfcl\xfc ve \xfc\xe7 Screen Actors Guild \xd6d\xfcl\xfc de dahil olmak \xfczere \xe7e\u015fitli \xf6d\xfcller ald\u0131.Bir\xe7ok televizyon dizisinde tekrar eden konuk oyuncu olarak yer ald\u0131 ve bir\xe7ok sahnede rol ald\u0131. \u0130lk filmini 31 ya\u015f\u0131nda Jolene (2008) ile yapan Chastain, \xe7\u0131k\u0131\u015f\u0131n\u0131 2011'de Take Shelter (2011) ve The Tree of Life (2011) dramalar\u0131 da dahil olmak \xfczere alt\u0131 filmle yapt\u0131. D\xf6nem dramas\u0131 The Help'te (2011) hevesli bir sosyeteyi ve gerilim filmi Zero Dark Thirty'de (2012) bir CIA analisti rol\xfcyle Akademi \xd6d\xfcl\xfc adayl\u0131\u011f\u0131 ald\u0131.","Frances McDormand, Nomadland filmiyle 2021 y\u0131l\u0131 En \u0130yi Kad\u0131n Oyuncu Oscar'\u0131n\u0131 alm\u0131\u015ft\u0131r.Frances Louise McDormand (d. 23 Haziran 1957, Chicago), Akademi \xd6d\xfcll\xfc Amerikal\u0131 sinema, tiyatro ve televizyon oyuncusudur. \xdc\xe7 kez En \u0130yi Yard\u0131mc\u0131 Kad\u0131n Oyuncu dal\u0131nda Oscar'a aday oldu. \xdc\xe7 kez En iyi Kad\u0131n Oyuncu Oscar \xf6d\xfcl\xfcn\xfc kazanm\u0131\u015ft\u0131r. 1996 y\u0131l\u0131nda Coen Karde\u015flerin Fargo filminde canland\u0131rd\u0131\u011f\u0131 hamile polis memuru Marge Gunderson rol\xfcyle En \u0130yi Kad\u0131n Oyuncu Oscar \xf6d\xfcl\xfcn\xfc kazand\u0131. 2018 y\u0131l\u0131nda Martin McDonagh taraf\u0131ndan yaz\u0131l\u0131p y\xf6netilmi\u015f 2017 \xe7\u0131k\u0131\u015fl\u0131 sinema filmi \xdc\xe7 Billboard Ebbing \xc7\u0131k\u0131\u015f\u0131, Missouri ile En iyi Kad\u0131n oyuncu Oscar \xf6d\xfcl\xfcn\xfc kazand\u0131. Ayn\u0131 ba\u015far\u0131y\u0131 2021 y\u0131l\u0131nda Chlo\xe9 Zhao imzal\u0131 Nomadland filmi ile yakalad\u0131. ","Ren\xe9e Zellweger, Judy filmiyle  2020 y\u0131l\u0131 En \u0130yi Kad\u0131n Oyuncu Oscar'\u0131n\u0131 alm\u0131\u015ft\u0131r. Ren\xe9e Kathleen Zellweger (d. 25 Nisan 1969), Amerikal\u0131 aktris, yap\u0131mc\u0131 ve \u015fark\u0131c\u0131. Zellweger iki Akademi \xd6d\xfcl\xfc, d\xf6rt Alt\u0131n K\xfcre \xd6d\xfcl\xfc ve iki BAFTA \xd6d\xfcl\xfc d\xe2hil olmak \xfczere \xe7ok say\u0131da \xf6d\xfcl ald\u0131. Zellweger, 2007 y\u0131l\u0131nda d\xfcnyan\u0131n en \xe7ok kazanan aktrislerinden biridir ve 2009 y\u0131l\u0131nda Hasty Pudding Theatricals taraf\u0131ndan Y\u0131l\u0131n Kad\u0131n\u0131 se\xe7ildi. Teksas'ta do\u011fan Zellweger, UT Austin'de \u0130ngiliz Edebiyat\u0131 okudu. Richard Linklater'\u0131n Dazed and Confused (1993) filminde k\xfc\xe7\xfck bir rolle ilk \xe7\u0131k\u0131\u015f\u0131n\u0131 takiben, Zellweger'in ilk ba\u015frol\xfc Texas Testere Katliam\u0131: Yeni Nesil (1994) ile geldi. Ba\u011f\u0131ms\u0131z A\u015fk ve 45 (1994) ve The Wide Wide World (1996) filmlerindeki performanslar\u0131 i\xe7in \xf6vg\xfc alan Zellweger, Jerry Maguire (1996), One True Thing (1998), Me, Myself filminde oynad\u0131\u011f\u0131 rollerle \xf6n plana \xe7\u0131kt\u0131. ","Olivia Colman, Saray\u0131n G\xf6zdesi filmiyle 2020 y\u0131l\u0131 En \u0130yi Kad\u0131n Oyuncu Oscar'\u0131n\u0131 alm\u0131\u015ft\u0131r.Sarah Caroline Colman (d. 30 Ocak 1974), sahne ad\u0131yla Olivia Colman, \u0130ngiliz oyuncu. Channel 4 (Britanya)'da yay\u0131nlanan komedi dizisi Peep Show (2003-15)'de Sophie Chapman karakteri ile tan\u0131n\u0131r. Oynad\u0131\u011f\u0131 di\u011fer televizyon komedi dizilerinden baz\u0131lar\u0131 ise \u015funlard\u0131r; Green Wing (2004-06), Beautiful People (2007), Rev (2010-14) ve Twenty Twelve (2011-12). Ayr\u0131ca That Mitchell and Webb Look (2006-08)'de yan\u0131 s\u0131ra Peep Show  y\u0131ld\u0131zlar\u0131 David Mitchell ve Robert Webb ile \xe7e\u015fitli rollerde oynam\u0131\u015ft\u0131r. Daha \xf6nce BAFTA \xf6d\xfcl\xfc kazanm\u0131\u015ft\u0131r. 2018 yap\u0131m\u0131 Saray\u0131n G\xf6zdesi filmindeki rol\xfcyle En \u0130yi Kad\u0131n Oyuncu Akademi \xd6d\xfcl\xfcn\xfc ve M\xfczikal ve Komedi dal\u0131nda En \u0130yi Kad\u0131n Oyuncu Alt\u0131n K\xfcre \xf6d\xfcl\xfcn\xfc kazanm\u0131\u015ft\u0131r."],t.s)
