$.avb=A.a(["Ariana DeBose Bat\u0131 Yakas\u0131'n\u0131n Hikayesi filmiyle 2022 y\u0131l\u0131 En \u0130yi Yard\u0131mc\u0131 Kad\u0131n Oyuncu Oscar'\u0131n\u0131 alm\u0131\u015ft\u0131r. Amerikal\u0131 aktris, \u015fark\u0131c\u0131 ve dans\xe7\u0131. Steven Spielberg'in West Side Story (2021) adl\u0131 m\xfczikal filminde Anita'y\u0131 canland\u0131rmas\u0131yla tan\u0131nd\u0131. Bu rol\xfcyle Akademi \xd6d\xfcl\xfc, BAFTA \xd6d\xfcl\xfc, Alt\u0131n K\xfcre \xd6d\xfcl\xfc ve Ekran Oyuncular\u0131 Derne\u011fi \xd6d\xfcl\xfc kazand\u0131. ","Yoon Yeo-jeong Minari filmiyle 2021 y\u0131l\u0131 En \u0130yi Yard\u0131mc\u0131 Kad\u0131n Oyuncu Oscar'\u0131n\u0131 alm\u0131\u015ft\u0131r. Youn Yuh-jung (d. 19 Haziran 1947) G\xfcney Koreli oyuncu. Film ve dizi alan\u0131nda yakla\u015f\u0131k olarak 50 y\u0131ld\u0131r \xe7al\u0131\u015fmaktad\u0131r. Daha \xe7ok Woman of Fire (1971), The Housemaid (2010), The Taste of Money (2012) ve The Bacchus Lady (2016)'den bilinir. ","Laura Dern Marriage Story filmiyle 2020 y\u0131l\u0131 En \u0130yi Yard\u0131mc\u0131 Kad\u0131n Oyuncu Oscar'\u0131n\u0131 alm\u0131\u015ft\u0131r. Laura Dern (d. 10 \u015eubat 1967), Amerikal\u0131 oyuncudur. 1991 yap\u0131m\u0131 Rambling Rose filmindeki performans\u0131yla En \u0130yi Kad\u0131n Oyuncu Akademi \xd6d\xfcl\xfc'ne aday g\xf6sterildi. Ayr\u0131ca Wild adl\u0131 2014 yap\u0131m\u0131 filmdeki performans\u0131yla En \u0130yi Yard\u0131mc\u0131 Kad\u0131n Oyuncu Akademi \xd6d\xfcl\xfc'ne aday g\xf6sterildi. Rol ald\u0131\u011f\u0131 di\u011fer filmler aras\u0131nda Mask (1985), Smooth Talk (1985), Mavi Kadife (1986), Vah\u015fi Duygular (1990), Jurassic Park (1993), Citizen Ruth (1996), Ekim D\xfc\u015f\xfc (1999), Benim Ad\u0131m Sam (2001), Inland Empire (2006), Usta (2012), Ayn\u0131 Y\u0131ld\u0131z\u0131n Alt\u0131nda (2014) ve Star Wars: Son Jedi (2017) bulunmaktad\u0131r. 1993'te Afterburn filmindeki performans\u0131yla En \u0130yi Kad\u0131n Oyuncu Alt\u0131n K\xfcre \xd6d\xfcl\xfc, 2009'da Recount filmindeki performans\u0131yla En \u0130yi Yard\u0131mc\u0131 Kad\u0131n Oyuncu Alt\u0131n K\xfcre \xd6d\xfcl\xfc, 2012'de Enlightened dizisindeki performans\u0131yla En \u0130yi Kad\u0131n Oyuncu Alt\u0131n K\xfcre \xd6d\xfcl\xfc ve Big Little Lies dizisindeki performans\u0131yla 2017'de \xdcst\xfcn Yard\u0131mc\u0131 Kad\u0131n Oyuncu Primetime Emmy \xd6d\xfcl\xfc ile 2018'de En \u0130yi Yard\u0131mc\u0131 Kad\u0131n Oyuncu Alt\u0131n K\xfcre \xd6d\xfcl\xfc'n\xfc kazand\u0131.","Regina King, If Beale Street Could Talk filmiyle 2019 y\u0131l\u0131 En \u0130yi Yard\u0131mc\u0131 Kad\u0131n Oyuncu Oscar'\u0131n\u0131 alm\u0131\u015ft\u0131r. Regina Rene King (d. 15 Ocak 1971), Amerikal\u0131 oyuncu ve televizyon y\xf6netmeni. \u0130lk olarak 1985 y\u0131l\u0131nda 227 televizyon dizisinde Brenda Jenkins olarak dikkat \xe7ekti. Cuma (1995) filminde Dana, Yeni Bir Ba\u015flang\u0131\xe7'taki (1996) Marcee Tidwell, hit animasyon dizisi The Boondocks'ta Riley ve Huey Freeman ve Southland'de dedektif Lydia Adams gibi rollerle daha fazla \xf6ne \xe7\u0131karak hem televizyonda hem de filmlerde ba\u015froller oynad\u0131. Southland'le , 2012 ve 2013'te Drama Dizisinde En \u0130yi Yard\u0131mc\u0131 Kad\u0131n Oyuncu dal\u0131nda iki Ele\u015ftirmenlerin Se\xe7imi Televizyon \xd6d\xfcl\xfc adayl\u0131\u011f\u0131 kazand\u0131."],t.s)
