$.avO=A.a(["Esaretin Bedeli imbd 9,3 ile birinci s\u0131rada yer al\u0131r. Stephen King'in Rita Hayworth ve Shawshank'in Kefareti adl\u0131 novellas\u0131ndan uyarlanan film, masumiyetini iddia etmesine ra\u011fmen kar\u0131s\u0131n\u0131 ve sevgilisini \xf6ld\xfcrd\xfc\u011f\xfc gerek\xe7esiyle Shawshank Devlet Cezaevi'nde yakla\u015f\u0131k 20 y\u0131l\u0131n\u0131 ge\xe7iren bankac\u0131 Andy Dufresne'in hik\xe2yesini anlat\u0131r","The Godfather imbd 9,2 ile ikinci s\u0131rada yer al\u0131r. Baba , Mario Puzo'nun yazd\u0131\u011f\u0131 ayn\u0131 adl\u0131 romandan uyarlanan, Francis Ford Coppola'n\u0131n y\xf6netti\u011fi, Marlon Brando ve Al Pacino'nun ba\u015frollerini payla\u015ft\u0131\u011f\u0131 filmdir. Filmde ayr\u0131ca yard\u0131mc\u0131 rollerde James Caan, Robert Duvall, Diane Keaton, John Cazale vard\u0131r. Filmin hik\xe2yesi, II. D\xfcnya Sava\u015f\u0131'n\u0131n bitti\u011fi y\u0131l olan 1945'te ba\u015flar ve 10 y\u0131ll\u0131k bir d\xf6nemi kapsar.","The Dark Knight imbd 9,0 ile \xfc\xe7\xfcnc\xfc s\u0131rada yer al\u0131r. Kara \u015e\xf6valye (\xf6zg\xfcn ad\u0131: The Dark Knight), Christopher Nolan'\u0131n y\xf6netti\u011fi bir s\xfcper kahraman filmidir. DC Comics'in kurgusal karakteri Batman'den uyarlanan 2005 tarihli Batman Ba\u015fl\u0131yor (Batman Begins) filminin devam\u0131d\u0131r. Kara \u015e\xf6valye'nin senaryosunu Christopher ve karde\u015fi Jonathan Nolan yazm\u0131\u015ft\u0131r. Hik\xe2yeyi ise David S. Goyer olu\u015fturmu\u015ftur.","The Godfather 2 imbd 9 ile ilk be\u015fin i\xe7erisinde yer al\u0131r. Baba II (\u0130ngilizce: The Godfather Part II), ilk filmin yap\u0131m\u0131ndan iki sene sonra \xe7ekilen film. Mario Puzo ve Francis Ford Coppola'n\u0131n ortak yazd\u0131\u011f\u0131 senaryoyla kurgulanm\u0131\u015ft\u0131r. 6 Oscar \xd6d\xfcl\xfc kazanm\u0131\u015ft\u0131r.,Baba II ayr\u0131ca, 1993 y\u0131l\u0131nda Kongre K\xfct\xfcphanesi taraf\u0131ndan k\xfclt\xfcrel, tarihi ve estetik olarak \xf6nemli filmler aras\u0131na se\xe7ilerek ABD Ulusal Film Ar\u015fivi'nde muhafaza edilmesine karar verilmi\u015ftir.","Schindler'in Listesi imbd 9 ile ilk be\u015fin i\xe7erisinde yer al\u0131r.Schindler'in Listesi (\u0130ngilizce: Schindler's List), y\xf6netmenli\u011fini Steven Spielberg'in yapt\u0131\u011f\u0131, 1993 ABD yap\u0131m\u0131 bir filmdir. II. D\xfcnya Sava\u015f\u0131 s\u0131ras\u0131nda Naziler'in uygulam\u0131\u015f oldu\u011fu soyk\u0131r\u0131mdan binin \xfczerinde Polonya Yahudisinin kurtar\u0131lmas\u0131nda rol\xfc olan Oskar Schindler'i ve bu kurtarmay\u0131 konu edinen film, 321 milyon dolar gi\u015fe has\u0131lat\u0131 elde etmi\u015f ve Akademi, Alt\u0131n K\xfcre, BAFTA ve Grammy \xf6d\xfclleri kazanm\u0131\u015ft\u0131r. "],t.s)
